import { View, TouchableOpacity, Text, Image} from "react-native";
import { useTailwind } from "tailwind-rn";
import { useNavigation } from "@react-navigation/native";

export default function Article() {
  const navigation = useNavigation();
  const tailwind = useTailwind();

  return (
    <View style={tailwind("gb-gray justify-center items-center")}>
      <Text style={tailwind("mt-[70px] mb-[10px] text-md")}>TITRE BROOOOOOOOOOOOOOOOO</Text>
      <TouchableOpacity onPress={() => navigation.navigate("Messagerie")}>
        <Image />
      </TouchableOpacity>
      <Text style={tailwind("mt-[20px] w-[90%] text-sm")}>
        Une exoplanète et une formidable nébuleuse : le 12 juillet, de nouvelles images du télescope spatial James Webb ont été dévoilées par la NASA, révélant la beauté et
